I'm not sure I understand your question correctly. Are you asking for a way to implement a pipe and filter system with 0 to 3 pipes and 0 to 1 pays (or payoffs) in a programming context?

In such a system, pipes would be functions that take input, process it, and pass it on to the next pipe in the chain. Pays would be functions that take the output of a pipe and perform some action based on the result.

Here's a simple example in Python:

```python
class Pipe:
    def __init__(self, func):
        self.func = func

    def process(self, input):
        return self.func(input)

class Pay:
    def __init__(self, func):
        self.func = func

    def payoff(self, output):
        return self.func(output)

# Example pipe and payoff functions
def double(x):
    return 2 * x

def square(x):
    return x ** 2

def print_result(x):
    print(x)

# Create pipes and payoffs
pipe1 = Pipe(double)
pipe2 = Pipe(square)
payoff = Pay(print_result)

# Connect the pipes and payoff in a chain
result = pipe1.process(5)  # Start with an input of 5
result = pipe2.process(result)  # Pass the result through pipe2
payoff.payoff(result)  # Perform the payoff action
```

In this example, we have two pipes (`double` and `square`) and one payoff (`print_result`). We create instances of these functions using the `Pipe` and `Pay` classes, and then connect them in a chain to process an input and perform a payoff action on the result.

In C programming, there are three types of variables: local variables, static variables, and global variables.

1. Local Variables: These are declared inside a function and are only accessible within that function. They are created and destroyed each time the function is called.

2. Global Variables: These are declared outside any function and are accessible from any part of the program. They are created when the program starts and destroyed when the program ends.

3. Static Variables: These are a combination of local and global variables. They are declared inside a function but have a property similar to global variables. They are created only once when the program starts and retain their value between function calls.

Here is an example to illustrate the difference between static and register variables:

```c
#include <stdio.h>

void function() {
    static int count = 0; // static variable
    register int i;        // register variable

    count++;
    printf("Count: %d\n", count);

    for(i = 0; i < 1000000; i++); // large loop to demonstrate register variable
}

int main() {
    function();
    function();
    function();

    return 0;
}
```

In this example, `count` is a static variable, and `i` is a register variable. The `count` variable retains its value between function calls, while the `i` variable is a high-speed variable that is stored in the CPU register instead of the memory.

When you run this program, you will see that the count increases with each function call, demonstrating the behavior of the static variable

