Here's a function that takes a date object representing the post time and returns the elapsed time since the post was made in the format "YYYY-MM-DD HH:mm:ss".

```typescript
function getElapsedTime(postTime: Date): string {
  const currentTime = new Date();
  const elapsedTime = currentTime.getTime() - postTime.getTime();

  const seconds = Math.floor((elapsedTime / 1000) % 60);
  const minutes = Math.floor((elapsedTime / (1000 * 60)) % 60);
  const hours = Math.floor((elapsedTime / (1000 * 60 * 60)) % 24);
  const days = Math.floor(elapsedTime / (1000 * 60 * 60 * 24));

  let result = "";

  if (days > 0) {
    result += `${days} days ago `;
  }

  if (hours > 0) {
    result += `${hours} hours ago `;
  }

  if (minutes > 0) {
    result += `${minutes} minutes ago `;
  }

  if (seconds > 0) {
    result += `${seconds} seconds ago `;
  }

  return result.trim();
}
```

